import React from "react";
import PhoneItem from "./PhoneItem";

function PhoneList({phones}) {
    return (
        <div>
            <h3>Phones</h3>
            {phones.map(phone => {
                return <PhoneItem phone={phone} key={phone.id}/>
            })}
        </div>
    )
}

export default PhoneList;
